import Table from 'react-bootstrap/Table'
import React , {useState, useEffect} from 'react'
import DataTable from 'react-data-table-component'
import 'bootstrap/dist/css/bootstrap.min.css';
// To use DataTable component for react you have to install npm library 
//npm install react-data-table-component
import { MDBCol, MDBFormInline, MDBIcon } from "mdbreact";

//Create table structure
const columns = [
  {
      name: 'Employee Name',
      selector: row => row.employeeName,
      sortable: true,

  },
  {
      name: 'Email',
      selector: row => row.email,
      sortable: true,
  },
  {
    name: 'Start Date',
    selector: row => row.startDate,
    sortable: true,
},
  {
    name: 'Department',
    selector: row => row.department,
    sortable: true,
},
{
  name: 'Position',
  selector: row => row.position,
  sortable: true,
},
{
  name: 'Account',
  selector: row => row.account,
  sortable: true,
},
{
  name: 'Status',
  selector: row => row.status,
  sortable: true,
},
{
  name: 'Training Category',
  selector: row => row.trainingCategoty,
  sortable: true,
},
{
  name: 'Course Name',
  selector: row => row.courseName,
  sortable: true,
},
{
  name: 'Training Delivery',
  selector: row => row.trainingDelivery,
  sortable: true,
},
{
  name: 'Provider',
  selector: row => row.provider,
  sortable: true,
},
{
  name: 'Instructor Name',
  selector: row => row.instructorName,
  sortable: true,
},
{
  name: 'Start Date Course',
  selector: row => row.startDateCourse,
  sortable: true,
},
{
  name: 'End Date',
  selector: row => row.endDate,
  sortable: true,
},
{
  name: 'Training Satus',
  selector: row => row.trainingStatus,
  sortable: true,
},
{
  name: 'Certificate Expiration Date',
  selector: row => row.certificateExpiration,
  sortable: true,
},
{
  name: 'Upload Certificate',
  selector: row => row.upload,
  sortable: true,
},
{
  name: 'Upload Certificate',
  selector: row => row.download,
  sortable: true,
},
];

const data = [
  {
      id: 1,
      title: 'Beetlejuice',
      year: '1988',
  },
  {
      id: 2,
      title: 'Ghostbusters',
      year: '1984',
  },
]

function TableContent() {
  return (
    <div className='table-responsive'>
      <DataTable
            columns={columns}
            data={data}
            title="Certificate Record"
            pagination
            fixedHeader
            fixedHeaderScrollHeight='600px'
        />
    </div>
  )
}


const SearchPage = () => {
  return (
    <MDBCol md="6">
      <MDBFormInline className="md-form">
        <MDBIcon icon="search" />
        <input className="form-control form-control-sm ml-3 w-75" type="text" placeholder="Search" aria-label="Search" />
      </MDBFormInline>
    </MDBCol>
  )
}
export default {TableContent,SearchPage}
